    D = {}
    for prime in primes:
        if prime in D:
            D[prime] += 1
        else:
            D[prime] = 1
    prod = reduce(lambda x, y: x * y % p, primes)
    deg = reduce(lambda x, y: x * y, (d + 1 for d in D.values()))
