        prod = reduce(lambda x, y: x * y % p, (pow(d, i // 2, p) for (d, i) in D.items()))
        ans = pow(prod, deg % (p - 1), p)
    else:
        ans = pow(prod, deg // 3 % (p - 1), p)
    return ans

